export default function Form2(props) {

    
    return (
        <form className='text-neutral-800 transition-all duration-300 font-regular text-[18px] px-8 w-full flex flex-col items-center gap-6'>
               
               <button className='py-2 px-6 bg-neutral-800 hover:bg-neutral-900 transition-all duration-300  text-white rounded-md mt-4 w-full'>View Account </button>
               <div className='text-[16px] text-neutral-600 flex justify-center ml-6 gap-5 w-full'>
                <button type='button' className='hover:text-neutral-800' onClick={()=>props.setForm(true)}>  Add Account  </button>
                -
                <button type='button'  className='hover:text-neutral-800'>View All Accounts </button>
               </div>
        </form>
    )
}
